schema:
{
 "description": "ProjectSpec defines the desired state of Project",
 "properties": {
  "assigneeType": {
   "description": "Task assignee type",
   "enum": [
    "PROJECT_LEAD",
    "UNASSIGNED"
   ],
   "type": "string"
  },
  "avatarId": {
   "description": "An integer value for the project's avatar.",
   "type": "integer"
  },
  "categoryId": {
   "description": "The ID of the project's category",
   "type": "integer"
  },
  "description": {
   "description": "Description for project",
   "type": "string"
  },
  "issueSecurityScheme": {
   "description": "The ID of the issue security scheme for the project, which enables you to control who can and cannot view issues",
   "type": "integer"
  },
  "key": {
   "description": "The project key is used as the prefix of your project's issue keys",
   "maxLength": 10,
   "pattern": "^[A-Z][A-Z0-9]+$",
   "type": "string"
  },
  "leadAccountId": {
   "description": "ID of project lead",
   "maxLength": 128,
   "type": "string"
  },
  "name": {
   "description": "Name of the project",
   "type": "string"
  },
  "notificationScheme": {
   "description": "The ID of the notification scheme for the project",
   "type": "integer"
  },
  "openAccess": {
   "description": "The Open Access status, which dictates who can access the project. If set to true all customers can access the project. If false, only customers added to project can access the project.",
   "type": "boolean"
  },
  "permissionScheme": {
   "description": "The ID of the permission scheme for the project",
   "type": "integer"
  },
  "projectTemplateKey": {
   "description": "A prebuilt configuration for a project",
   "type": "string"
  },
  "projectTypeKey": {
   "description": "The project type, which dictates the application-specific feature set",
   "enum": [
    "business",
    "service_desk",
    "software"
   ],
   "type": "string"
  },
  "url": {
   "description": "A link to information about this project, such as project documentation",
   "pattern": "(http|ftp|https)://([a-zA-Z0-9~!@#$%^\u0026*()_=+/?.:;',-]*)?",
   "type": "string"
  }
 },
 "required": [
  "assigneeType",
  "description",
  "key",
  "leadAccountId",
  "name",
  "projectTemplateKey",
  "projectTypeKey"
 ],
 "title": "Project",
 "type": "object"
}
